--
-- Name: convert_number(text); Type: FUNCTION; Schema: public; Owner: cpbx
--

CREATE FUNCTION convert_number(number text) RETURNS text
    LANGUAGE plpgsql
    AS $_$
        BEGIN
 number = regexp_replace(number,'\+',E'\\1');
number = regexp_replace(number,'^([0-9]{10})$',E'7\\1');
number = regexp_replace(number,'^([0-9]{7})$',E'7495\\1');
number = regexp_replace(number,'^(8[0-9]{11})$',E'7\\1');
number = regexp_replace(number,'^(8)([0-9]{10})$',E'7\\2');
number = regexp_replace(number,'^(810)([0-9]{10,})$',E'\\2');
number = regexp_replace(number,'^[0-9]{1,6}$','');
return number;
         END;
$_$;


ALTER FUNCTION public.convert_number(number text) OWNER TO cpbx;

--
-- Name: extract_callerid(text); Type: FUNCTION; Schema: public; Owner: cpbx
--

CREATE FUNCTION extract_callerid(number text) RETURNS text[]
    LANGUAGE plpgsql
    AS $$
        BEGIN

 number = regexp_replace(number,'\+',E'\\1');
number = regexp_replace(number,'"([0-9]{10})"',E'"7\\1"');
number = regexp_replace(number,'<([0-9]{10})>',E'<7\\1>');
number = regexp_replace(number,'"([0-9]{7})"',E'"7495\\1"');
number = regexp_replace(number,'<([0-9]{7})>',E'<7495\\1>');
number = regexp_replace(number,'"([0-9]{1,6})"','');
number = regexp_replace(number,'<([0-9]{1,6})>','');
 return regexp_matches(number,'"([0-9]+)" <([0-9]+)>');
        END;
$$;


