--

CREATE FUNCTION search_direction(direction text) RETURNS SETOF directions
    LANGUAGE sql IMMUTABLE
    AS $_$
   
  WITH RECURSIVE t(id,breakchain) AS (
    VALUES ((SELECT id FROM directions WHERE name::text =ANY((WITH RECURSIVE k(src,dst,scursor) AS (VALUES($1,ARRAY[]::text[],length($1))
    UNION ALL
     SELECT left(src,scursor),array_append(dst,left(src,scursor)),scursor-1 FROM k WHERE scursor>0
    ) SELECT dst FROM k  ORDER BY scursor LIMIT 1)::text[]) AND root=610080 ORDER BY LENGTH(name) DESC LIMIT 1),true)
  UNION ALL
    SELECT parent,(CASE WHEN class=700 AND type=1024 THEN true ELSE false END) FROM directions d,t WHERE t.breakchain AND t.id=d.id  AND root=610080
) SELECT d.* FROM t LEFT JOIN directions d on (d.id=t.id)
   $_$;


