--
-- Name: vpbx_callcentre_operators_activity(); Type: FUNCTION; Schema: public; Owner: cpbx
--

CREATE FUNCTION vpbx_callcentre_operators_activity() RETURNS TABLE(extens integer, avgactivity time without time zone)
    LANGUAGE plpgsql
    AS $$
DECLARE calldates date[];
DECLARE calldate date;
DECLARE extensions int[];
DECLARE exten int;
DECLARE accumulatedtime interval;
DECLARE oldstatus vpbx_operatorstatus;
DECLARE timebar time;
DECLARE hs_row record;
BEGIN
	calldates := (ARRAY(SELECT DISTINCT ON (date_trunc('day', changed)::date) date_trunc('day', changed)::date  
		FROM operator_status_log 
		WHERE EXTRACT(DOW FROM  changed) 
		NOT IN (0,6))
	);
	extensions := ARRAY(SELECT extension e FROM operator_status_log GROUP BY e);
	
	FOREACH exten  IN ARRAY extensions -- aggregating average activity for each extension then returning that
	LOOP
		accumulatedtime = '00:00:00';
    	FOREACH calldates IN ARRAY calldate -- iterating through all working
    										-- days thus accumualting average for specific extension
    	LOOP
    		oldstatus:= (SELECT operatorstatus FROM operator_status_log 
    		WHERE changed<(calldate+(interval '9 hours')) 
    		AND extension=exten LIMIT 1);	-- determining operator status at the beginning 
    										-- of each day, if unable to do so then assuming 
    										-- that the status is "LOGGED_IN" by default
    		IF NOT FOUND THEN
    			oldstatus:='LOGGED_IN';
    		END IF;
    		
    		timebar = '09:00:00'::time;
    		
    		for hs_row IN     -- looping through records whitin a day		
    			(SELECT operatorstatus FROM operator_status_log 
    			WHERE changed>=(calldate+(interval '9 hours')) 
    			AND changed=<(calldate+(interval '17 hours')) AND extension = exten ORDER BY changed)
    		LOOP
    			if hs_row.operatorstatus!=oldstatus THEN -- extra check to avoid inconsistencies
    				if oldstatus = 'LOGGED_IN' THEN
    					accumulatedtime = accumulatedtime + (to_char(hs_row.changed,'HH24:MI:SS')::time-timebar);
    				END IF;
    				timebar = date_cut(hs_row.changed);    				
    			END IF;
    		END LOOP;
    		
    		if oldstatus = 'LOGGED_IN' THEN -- adding up to the end of the working day
    			accumulatedtime = accumulatedtime + ('17:00:00'::time - to_char((oldstatus,'HH24:MI:SS')::time));
    		END IF;  		    		
    	END LOOP;
    	
    	RETURN QUERY SELECT exten, (accumulatedtime/(array_length(calldates,1)));
    	
	END LOOP;
	
 END;
$$;


