--

CREATE FUNCTION vpbx_crm_working_hour() RETURNS boolean
    LANGUAGE plpgsql
    AS $$DECLARE
 schedulestatus boolean;

BEGIN
schedulestatus := (SELECT isworkinghour FROM pbx_working_hour_fromdb);
IF schedulestatus !=false 
THEN
schedulestatus:= ( SELECT date_part('dow'::text, now()) >= 1::double precision 
           AND date_part('dow'::text, now()) <= 5::double precision) 
           AND ( SELECT date_part('hour'::text, now()) >= 10::double precision 
           AND date_part('hour'::text, now()) <= 19::double precision) AS workinghour;
END IF;
RETURN schedulestatus;

END;
$$;


