-- Name: vpbx_get_call_direction_data_for_channel(text[], integer); Type: FUNCTION; Schema: public; Owner: cpbx
--

CREATE FUNCTION vpbx_get_call_direction_data_for_channel(num text[], root integer) RETURNS SETOF vpbx_call_dir_for_chan
    LANGUAGE sql IMMUTABLE
    AS $_$
WITH u 
AS(
SELECT * 
FROM vpbx_get_num_properties($1,$2) 
AS (v int ,s int[])
) SELECT ROW_NUMBER() OVER (PARTITION BY NULL) 
AS position, (
SELECT sname 
FROM directions 
WHERE id=u.s[3]) 
AS direction,
CASE WHEN 610100=ANY(u.s) 
THEN CASE WHEN 641635=ANY(u.s) THEN 'mobile' ELSE 'national'  END
WHEN 610120=ANY(u.s) 
THEN 'international' 
WHEN 694433=ANY(u.s) 
THEN 'local'  
END,
u.s[3] as city
,(SELECT sname FROM directions WHERE id=u.s[1]) as code
FROM u

$_$;


