--
-- Name: cdr_callcentre_calls_missed; Type: VIEW; Schema: public; Owner: cpbx
--

CREATE VIEW cdr_callcentre_calls_missed AS
 SELECT c.id,
    c.calldate,
    c.operatorcalledids,
    c.operatorcallednums,
    (COALESCE(array_length(c.operatorcallednums, 1), 0) > 0) AS operatoravailany,
    array_fill(true, ARRAY[COALESCE(array_length(c.operatorcallednums, 1), 0)]) AS operatoravail,
    c.linkedid
   FROM ( SELECT cdr.id,
            cdr.calldate,
            cdr.linkedid,
            ARRAY( SELECT t.id
                   FROM cdr t
                  WHERE ((((cdr.linkedid)::text = (t.linkedid)::text) AND ((t.dcontext)::text = 'extenreceive'::text)) AND ((cdr.disposition)::text = 'NO ANSWER'::text))) AS operatorcalledids,
            ARRAY( SELECT t.dst
                   FROM cdr t
                  WHERE ((((cdr.linkedid)::text = (t.linkedid)::text) AND ((t.dcontext)::text = 'extenreceive'::text)) AND ((cdr.disposition)::text = 'NO ANSWER'::text))) AS operatorcallednums
           FROM cdr
          WHERE ((((cdr.dcontext)::text = 'callcentre'::text) AND ((cdr.disposition)::text <> 'ANSWERED'::text)) AND (cdr.duration > 7))) c;


ALTER TABLE public.cdr_callcentre_calls_missed OWNER TO cpbx;

--
-- Name: callcentrestat; Type: VIEW; Schema: public; Owner: cpbx
--

CREATE VIEW callcentrestat AS
 SELECT ( SELECT count(cdr.id) AS count
           FROM cdr
          WHERE (((cdr.calldate >= date_trunc('day'::text, now())) AND ((cdr.dcontext)::text = 'callcentre'::text)) AND (cdr.duration > 7))) AS totaltoday,
    ( SELECT count(cdr_callcentre_calls_missed.id) AS count
           FROM cdr_callcentre_calls_missed
          WHERE (cdr_callcentre_calls_missed.calldate >= date_trunc('day'::text, now()))) AS missedtoday,
    ( SELECT count(cdr.id) AS count
           FROM cdr
          WHERE (((cdr.calldate >= (now() - '24:00:00'::interval)) AND ((cdr.dcontext)::text = 'callcentre'::text)) AND (cdr.duration > 7))) AS total24hrs,
    ( SELECT count(cdr_callcentre_calls_missed.id) AS count
           FROM cdr_callcentre_calls_missed
          WHERE (cdr_callcentre_calls_missed.calldate >= (now() - '24:00:00'::interval))) AS missed24hrs,
    ( SELECT count(cdr.id) AS count
           FROM cdr
          WHERE (((cdr.calldate >= date_trunc('month'::text, now())) AND ((cdr.dcontext)::text = 'callcentre'::text)) AND (cdr.duration > 7))) AS totalthismonth,
    ( SELECT count(cdr_callcentre_calls_missed.id) AS count
           FROM cdr_callcentre_calls_missed
          WHERE (cdr_callcentre_calls_missed.calldate >= date_trunc('month'::text, now()))) AS missedthismonth,
    ( SELECT count(cdr.id) AS count
           FROM cdr
          WHERE (((cdr.calldate >= (now() - '30 days'::interval)) AND ((cdr.dcontext)::text = 'callcentre'::text)) AND (cdr.duration > 7))) AS total30days,
    ( SELECT count(cdr_callcentre_calls_missed.id) AS count
           FROM cdr_callcentre_calls_missed
          WHERE (cdr_callcentre_calls_missed.calldate >= (now() - '30 days'::interval))) AS missed30days,
    ( SELECT count(*) AS count
           FROM cdr
          WHERE (((cdr.dcontext)::text = 'callcentre'::text) AND (cdr.duration > 7))) AS totalintegral,
    ( SELECT count(cdr_callcentre_calls_missed.id) AS count
           FROM cdr_callcentre_calls_missed) AS missedintegral;


