--
-- Name: cdr_callcentre_calls_answered; Type: VIEW; Schema: public; Owner: cpbx
--

CREATE VIEW cdr_callcentre_calls_answered AS
 SELECT t.id,
    t.calldate,
    t.operatoranswerednum[1] AS operatoranswerednum,
    t.operatoransweredbillsec[1] AS operatoransweredbillsec,
    t.vpbxid
   FROM ( SELECT t_1.id,
            c.calldate,
            c.vpbxid,
            ARRAY( SELECT cdr.dst
                   FROM cdr
                  WHERE (((cdr.linkedid)::text = (t_1.linkedid)::text) AND ((cdr.dcontext)::text = 'dialsipexten'::text))) AS operatorcalledids,
            ARRAY( SELECT cdr.dst
                   FROM cdr
                  WHERE ((((cdr.linkedid)::text = (t_1.linkedid)::text) AND ((cdr.dcontext)::text = 'dialsipexten'::text)) AND ((cdr.disposition)::text = 'ANSWERED'::text))) AS operatoranswerednum,
            ARRAY( SELECT cdr.billsec
                   FROM cdr
                  WHERE ((((cdr.linkedid)::text = (t_1.linkedid)::text) AND ((cdr.dcontext)::text = 'dialsipexten'::text)) AND ((cdr.disposition)::text = 'ANSWERED'::text))) AS operatoransweredbillsec
           FROM (( SELECT cdr.id,
                    cdr.linkedid
                   FROM cdr
                  WHERE ((cdr.dcontext)::text = 'vpbx_dialin'::text)) t_1
      LEFT JOIN cdr c ON ((c.id = t_1.id)))
     WHERE (((c.disposition)::text = 'ANSWERED'::text) AND (c.duration > 7))
     ORDER BY c.calldate) t
  WHERE (array_length(t.operatoranswerednum, 1) > 0);


