--
-- Name: cdr_callcentre_calls_answered_operators_average; Type: VIEW; Schema: public; Owner: cpbx
--

CREATE VIEW cdr_callcentre_calls_answered_operators_average AS
 WITH integral AS (
         SELECT cdr_callcentre_calls_answered.operatoranswerednum,
            avg(cdr_callcentre_calls_answered.operatoransweredbillsec) AS avg
           FROM cdr_callcentre_calls_answered
          GROUP BY cdr_callcentre_calls_answered.operatoranswerednum
        ), today AS (
         SELECT cdr_callcentre_calls_answered.operatoranswerednum,
            avg(cdr_callcentre_calls_answered.operatoransweredbillsec) AS avg
           FROM cdr_callcentre_calls_answered
          WHERE (cdr_callcentre_calls_answered.calldate >= date_trunc('day'::text, now()))
          GROUP BY cdr_callcentre_calls_answered.operatoranswerednum
        ), thismonth AS (
         SELECT cdr_callcentre_calls_answered.operatoranswerednum,
            avg(cdr_callcentre_calls_answered.operatoransweredbillsec) AS avg
           FROM cdr_callcentre_calls_answered
          WHERE (cdr_callcentre_calls_answered.calldate >= date_trunc('month'::text, now()))
          GROUP BY cdr_callcentre_calls_answered.operatoranswerednum
        )
 SELECT integral.operatoranswerednum AS extension,
    trunc(integral.avg, 2) AS integral,
    trunc(t.avg, 2) AS today,
    trunc(m.avg, 2) AS thismonth
   FROM ((integral
   LEFT JOIN today t ON (((t.operatoranswerednum)::text = (integral.operatoranswerednum)::text)))
   LEFT JOIN thismonth m ON (((m.operatoranswerednum)::text = (integral.operatoranswerednum)::text)))
  ORDER BY integral.operatoranswerednum;


