--
-- Name: cdr_callcentre_operator_stat; Type: VIEW; Schema: public; Owner: cpbx
--

CREATE VIEW cdr_callcentre_operator_stat AS
 WITH operatorsactive AS (
         SELECT cop_avg.extension,
            cop_avg.integral AS average_integral,
            cop_avg.today AS average_today,
            cop_avg.thismonth AS average_thismont,
            0 AS accepted_integral,
            0 AS accepted_today,
            0 AS accepted_thismonth,
            0 AS missed_integral,
            0 AS missed_today,
            0 AS missed_thismonth,
            0 AS activity_integral,
            0 AS activity_today,
            0 AS activity_thismonth
           FROM cdr_callcentre_calls_answered_operators_average cop_avg
          WHERE ((cop_avg.extension)::integer IN ( SELECT DISTINCT sip.extension
                   FROM sip
                  WHERE (sip.extensiontype = 'operator'::vpbx_sip_extensiontype)))
        )
         SELECT operatorsactive.extension,
            operatorsactive.average_integral,
            operatorsactive.average_today,
            operatorsactive.average_thismont,
            operatorsactive.accepted_integral,
            operatorsactive.accepted_today,
            operatorsactive.accepted_thismonth,
            operatorsactive.missed_integral,
            operatorsactive.missed_today,
            operatorsactive.missed_thismonth,
            operatorsactive.activity_integral,
            operatorsactive.activity_today,
            operatorsactive.activity_thismonth
           FROM operatorsactive
UNION
         SELECT DISTINCT (sip.extension)::text AS extension,
            0 AS average_integral,
            0 AS average_today,
            0 AS average_thismont,
            0 AS accepted_integral,
            0 AS accepted_today,
            0 AS accepted_thismonth,
            0 AS missed_integral,
            0 AS missed_today,
            0 AS missed_thismonth,
            0 AS activity_integral,
            0 AS activity_today,
            0 AS activity_thismonth
           FROM sip
          WHERE ((sip.extensiontype = 'operator'::vpbx_sip_extensiontype) AND (NOT (sip.extension IN ( SELECT (operatorsactive.extension)::integer AS extension
                   FROM operatorsactive))))
  ORDER BY 1;


