-- Name: conferencefree; Type: VIEW; Schema: public; Owner: cpbx
--

CREATE VIEW conferencefree AS
 SELECT (p.confnumber)::integer AS confnumber
   FROM ( SELECT (generate_series(1000, 9999))::text AS confnumber) p
  WHERE (NOT (p.confnumber IN ( SELECT conference.confnumber
           FROM conference
          WHERE (now() < conference.datesettoexpiry))))
  ORDER BY random();


