--
-- Name: musiconhold_view; Type: VIEW; Schema: public; Owner: cpbx
--

CREATE VIEW musiconhold_view AS
        (        (        (         SELECT 1 AS id,
                                    ((pbx_settings.vpbxid)::text || '_greeting'::text) AS name,
                                    (((pbx_settings.mediarepospath)::text || '/'::text) || (pbx_settings.greeting)::text) AS directory,
                                    ''::text AS application,
                                    'files'::text AS mode,
                                    ''::text AS digit,
                                    ''::text AS sort,
                                    ''::text AS format
                                   FROM pbx_settings
                                  WHERE (pbx_settings.vpbxid = 1)
                        UNION ALL
                                 SELECT 2 AS id,
                                    ((pbx_settings.vpbxid)::text || '_greetingofftime'::text) AS name,
                                    (((pbx_settings.mediarepospath)::text || '/'::text) || (pbx_settings.greetingofftime)::text) AS directory,
                                    ''::text AS application,
                                    'files'::text AS mode,
                                    ''::text AS digit,
                                    ''::text AS sort,
                                    ''::text AS format
                                   FROM pbx_settings
                                  WHERE (pbx_settings.vpbxid = 1))
                UNION ALL
                         SELECT 3 AS id,
                            'default'::text AS name,
                            (((pbx_settings.mediarepospath)::text || '/'::text) || (pbx_settings.mohtone)::text) AS directory,
                            ''::text AS application,
                            'files'::text AS mode,
                            ''::text AS digit,
                            ''::text AS sort,
                            ''::text AS format
                           FROM pbx_settings
                          WHERE (pbx_settings.vpbxid = 1))
        UNION ALL
                 SELECT 4 AS id,
                    ((pbx_settings.vpbxid)::text || '_ringingtone'::text) AS name,
                    (((pbx_settings.mediarepospath)::text || '/'::text) || (pbx_settings.ringingtone)::text) AS directory,
                    ''::text AS application,
                    'files'::text AS mode,
                    ''::text AS digit,
                    ''::text AS sort,
                    ''::text AS format
                   FROM pbx_settings
                  WHERE (pbx_settings.vpbxid = 1))
UNION ALL
         SELECT musiconhold.id,
            musiconhold.name,
            musiconhold.directory,
            musiconhold.application,
            musiconhold.mode,
            musiconhold.digit,
            musiconhold.sort,
            musiconhold.format
           FROM musiconhold;


ALTER TABLE public.musiconhold_view OWNER TO cpbx;

