--
-- Name: pbx_working_hour_fromdb; Type: VIEW; Schema: public; Owner: cpbx
--

CREATE VIEW pbx_working_hour_fromdb AS
 SELECT p.isworkinghour,
    r.vpbxid
   FROM (( SELECT DISTINCT pbx_settings.vpbxid
           FROM pbx_settings) r
   LEFT JOIN ( SELECT
                CASE s.isworking
                    WHEN 1 THEN true
                    WHEN 0 THEN false
                    ELSE NULL::boolean
                END AS isworkinghour,
            s.vpbxid
           FROM schedule_replacements s
          WHERE (s.rdate = date_trunc('day'::text, now()))) p ON ((p.vpbxid = r.vpbxid)));


ALTER TABLE public.pbx_working_hour_fromdb OWNER TO cpbx;

